{-# LANGUAGE DeriveDataTypeable, DeriveAnyClass, DeriveGeneric    #-}

module Auxiliary.Logic (
    Logic(..), eqLogic, bigLogic, biggerLogic , smallerLogic
  ) where

import Data.Generics (Typeable, gshow, Data)
import Data.Int (Int32(..))
import System.Random

import Control.Parallel
import Control.DeepSeq
import GHC.Generics

-- Logic datatype
data Logic = Var String Int
           | T                            -- true
           | F                            -- false
           | Not Logic                    -- not
           | Impl  Logic Logic            -- implication
           | Equiv Logic Logic            -- equivalence
           | Conj  Logic Logic            -- and (conjunction)
           | Disj  Logic Logic            -- or (disjunction)
  deriving (Typeable, Show, Eq, NFData, Generic, Data)


eqLogic :: Logic -> Logic -> Bool
eqLogic (Var s i)   (Var q j)   = s == q && i == j
eqLogic (Impl  p q) (Impl  r s) = eqLogic p r && eqLogic q s
eqLogic (Equiv p q) (Equiv r s) = eqLogic p r && eqLogic q s
eqLogic (Conj  p q) (Conj  r s) = eqLogic p r && eqLogic q s
eqLogic (Disj  p q) (Disj  r s) = eqLogic p r && eqLogic q s
eqLogic (Not p)     (Not q)     = eqLogic p q
eqLogic T           T           = True
eqLogic F           F           = True
eqLogic _           _           = False

eqLogicPar :: Logic -> Logic -> Bool
eqLogicPar (Var s i)   (Var q j)   = s == q && i == j
eqLogicPar (Impl  p q) (Impl  r s) = evalPar p q r s
eqLogicPar (Equiv p q) (Equiv r s) = evalPar p q r s
eqLogicPar (Conj  p q) (Conj  r s) = evalPar p q r s
eqLogicPar (Disj  p q) (Disj  r s) = evalPar p q r s
eqLogicPar (Not p)     (Not q)     = eqLogicPar p q
eqLogicPar T           T           = True
eqLogicPar F           F           = True
eqLogicPar _           _           = False

{-# INLINE evalPar #-}
evalPar p q r s = par y (pseq x (x && y))
  where x = eqLogicPar p r
        y = eqLogicPar q s

-- Fully seq a Logic expression
seqLogic :: Logic -> a -> a
seqLogic (Var s i)   b = seq s (seq i b)
seqLogic (Impl p  q) b = seqLogic p (seqLogic q b)
seqLogic (Equiv p q) b = seqLogic p (seqLogic q b)
seqLogic (Conj p  q) b = seqLogic p (seqLogic q b)
seqLogic (Disj p  q) b = seqLogic p (seqLogic q b)
seqLogic (Not p)     b = seqLogic p b
seqLogic T           b = b
seqLogic F           b = b

-- Evaluate a Logic expression
evalLogic :: (String -> Int -> Bool) -> Logic -> Bool
evalLogic env (Var s i)   = env s i
evalLogic env (Impl  p q) = evalLogic env (Not p) || evalLogic env q
evalLogic env (Equiv p q) = evalLogic env p == evalLogic env q
evalLogic env (Conj  p q) = evalLogic env p && evalLogic env q
evalLogic env (Disj  p q) = evalLogic env p || evalLogic env q
evalLogic env (Not p)     = not (evalLogic env p)
evalLogic env T           = True
evalLogic env F           = False

evalLogicPar :: (String -> Int -> Bool) -> Logic -> Bool
evalLogicPar env (Var s i)   = env s i
evalLogicPar env (Impl  p q) = evalPar' (evalLogicPar env) (||) (Not p) q
evalLogicPar env (Equiv p q) = evalPar' (evalLogicPar env) (==) p q
evalLogicPar env (Conj  p q) = evalPar' (evalLogicPar env) (&&) p q
evalLogicPar env (Disj  p q) = evalPar' (evalLogicPar env) (||) p q
evalLogicPar env (Not p)     = not (evalLogicPar env p)
evalLogicPar env T           = True
evalLogicPar env F           = False

{-# INLINE evalPar' #-}
evalPar' f op x y = l `par` r `pseq` (l `op` r)
  where l = f x
        r = f y

-- Change all T into F
tweakLogic :: Logic -> Logic
tweakLogic (Var s i)   = Var s i
tweakLogic (Impl  p q) = Impl  (tweakLogic p) (tweakLogic q)
tweakLogic (Equiv p q) = Equiv (tweakLogic p) (tweakLogic q)
tweakLogic (Conj  p q) = Conj  (tweakLogic p) (tweakLogic q)
tweakLogic (Disj  p q) = Disj  (tweakLogic p) (tweakLogic q)
tweakLogic (Not p)     = Not (tweakLogic p)
tweakLogic T           = F
tweakLogic F           = F


genLogic :: [Int] -> Int -> Logic
genLogic []  n = case rem n 3 of
                   0 -> Var ("x" ++ show (rem n 10)) n
                   1 -> T
                   _ -> F
genLogic [x] _ = genLogic [] x
genLogic l   n = let (l1, l2) = (tail l, tail (tail l))
                 in case rem (head l) 5 of
                      0 -> Impl  (genLogic l1 n) (genLogic l2 n)
                      1 -> Equiv (genLogic l1 n) (genLogic l2 n)
                      2 -> Conj  (genLogic l1 n) (genLogic l2 n)
                      4 -> Disj  (genLogic l1 n) (genLogic l2 n)
                      _ -> Not (genLogic l1 n)


bigLogics :: [Logic]
bigLogics = [bigLogicGen seed | seed <- [123456789..223456789]]

bigLogicGen :: Int -> Logic
bigLogicGen seed = let (s1, s2) = select $ randomRs (0,100) (mkStdGen seed)
                       select (h:t) = (take 29 t, h)
                   in genLogic s1 s2

biggerLogic :: Logic
biggerLogic = let (s1, s2) = select $ randomRs (0,100) (mkStdGen 123456789)
                  select (h:t) = (take 34 t, h)
              in genLogic s1 s2

-- Big Logic expression (size 810250)
bigLogic :: Logic
bigLogic = head bigLogics

bigLogicString :: String
bigLogicString = error "bigLogicString undefined" --gshow bigLogic

smallerLogics :: [Logic]
smallerLogics = [smallerLogicGen seed | seed <- [123456788..223456789]]

smallerLogicGen :: Int -> Logic
smallerLogicGen seed = let (s1, s2) = select $ randomRs (0,100) (mkStdGen seed)
                           select (h:t) = (take 23 t, h)
                       in genLogic s1 s2

